import Card from './Components/Card';
import Navbar from './Components/Navbar';

import { useCallback, useEffect, useState } from 'react';

function App() {
  interface SongsType {
    artistName: string;
    songName: string;
    added: boolean;
    image: string;
  }
  
  const songs:SongsType[] = [
    {
      artistName: 'Adele',
      songName: 'Hello',
      added: false,
      image:"data:image/jpeg;base64,"
    },
    {
      artistName: 'Ed Sheeran',
      songName: 'Shape of You',
      added: false,
      image:"data:image/jpeg;base64,"
    },
    {
      artistName: 'Dua Lipa',
      songName: 'Levitating',
      added: false,
      image:"data:image/jpeg;base64,"
    },
    {
      artistName: 'The Weeknd',
      songName: 'Blinding Lights',
      added: false,
      image:"data:image/jpeg;base64,"
    },
    {
      artistName: 'Billie Eilish',
      songName: 'Bad Guy',
      added: false,
      image:"data:image/jpeg;base64,"
    },
    {
      artistName: 'Ariana Grande',
      songName: 'Thank you next',
      added: false,
      image:"data:image/jpeg;base64,"
    },
    {
      artistName: 'Kendrick Lamar',
      songName: 'Not Like Us',
      added: false,
      image:"data:image/jpeg;base64,"
    },
    {
      artistName: 'Taylor Swift',
      songName: 'Blank Space',
      added: false,
      image:"data:image/jpeg;base64,"
    }
];
  const [data,setData]=useState(songs);
  const [filteredSongs, setFilteredSongs] = useState([])
  function handleData(index:number) {
    setData((prev) =>
      prev.map((item, itemIndex) =>
        itemIndex === index ? { ...item, added: !item.added } : item
      )
    );
  }
  const handleSearch=useCallback((text:string)=>{
    const lowercasedSongs = text.toLowerCase();
    const newFilteredSongs = data.filter(song =>
      song.artistName.toLowerCase().includes(lowercasedSongs) 
    );
    setFilteredSongs(newFilteredSongs);
    console.log("usecallback")
  },[data])
  useEffect(()=>{
console.log("useEffect called")
  },[data])
 

 return (
    <>
  <div className='w-full h-screen bg-zinc-300 '>
   
    <Navbar data={data} handleSearch={handleSearch}/>
    <div className='px-20 flex gap-10 mt-10 flex-wrap'> 
     {(filteredSongs.length > 0 ? filteredSongs : data).map((items,index)=>(
        <Card items={items} key={index} index={index} handleData={handleData}/>
      ))}
    </div>
   
   

  </div>

    </>
  )
}

export default App
